// @updateURL https://update.greasyfork.org/scripts/549580/Copilot%E8%81%8A%E5%A4%A9%E5%A4%B4%E5%83%8F%E6%9B%BF%E6%8D%A2%EF%BC%88%E6%94%AF%E6%8C%81%E5%AE%9A%E5%88%B6%E5%A4%A7%E5%B0%8F%2B%E5%BA%95%E9%83%A8%E9%98%B4%E5%BD%B1%EF%BC%89.meta.js
