(function() {
    'use strict';

    const cuteImgUrl = "data:image/png;base64,";
    const cuteImgUrl大大 = "";
    // const cuteImgUrl = "data:image/jpeg;base64,"
    const imgWidth = 32;
    const imgHeight = 32;

    function replaceAvatar() {
        // 查静态头像，动画的SVG（比如有spin、loading、circle等关键词的class）, 因为微软的copilot一开始是动画
        const avatarSvgs = [
            ...document.querySelectorAll('svg[class*="Static-module__static"]'),
            ...document.querySelectorAll('svg[class*="spin"],svg[class*="loading"],svg[class*="circle"]')
        ];
        avatarSvgs.forEach(svg => {
            // 已经替换过就不要重复
            if (svg.dataset.cuteReplaced) return;
            // 只替换头像区域，不要误伤
            if (!svg.closest('[class*="Avatar-module"]') && !svg.closest('[class*="avatar"]')) return;

            // 头像替换
            const img = document.createElement('img');
            img.src = cuteImgUrl;
            img.width = imgWidth;
            img.height = imgHeight;
            img.alt = '我就喜欢改成二次元';
            img.style.borderRadius = '80%';
            img.style.boxShadow = '0 6px 16px -4px rgba(0,0,0,0.0), 0 9px 28px 0 rgba(0,0,0,0.0)';
            img.style.objectFit = 'cover';
            svg.parentNode.replaceChild(img, svg);
            img.dataset.cuteReplaced = "true";
        });
    }

    // 先抢占一次
    replaceAvatar();

    // 监听头像区域的DOM变化，动画→静态切换，第一时间捕捉到
    const avatarWrapper = document.querySelector('[class*="Avatar-module"],[class*="avatar"]') || document.body;
    const observer = new MutationObserver(replaceAvatar);
    observer.observe(avatarWrapper, { childList: true, subtree: true });

    // 保险起见，定时轮询也留着
    //setInterval(replaceAvatar, 1000);
})();